    "assunto": "Relatório do dia",
    "mensagem": "Hoje a Cínara não veio trabalhar pois estava doente, o Reginaldo saiu as 15:00h porque a esposa dele estar hospitalizada (foi visitar), Então só ficou o Zezim que tirou direto e passou das 18:00h porque tinha que entregar as encomendas de Fortaleza OBS: O Zezim levou hj 2hs para lixar e polir uma puls. Rupes. Emp para poder voltar para cravar o Reginaldo levou 1 hs para fazer o mesmo processo com o anel floral isso eles conversando. Não deu para marca o tempo que levaram para fazer as peças depois de cravada pois fui almoçar  e ao chegar já estavam fazendo sem contar que tiver 2 reunião com o Rabelo uma foi para falar do relatório e a outro foi para falar como as pessoas vão ter quer andar na fabrica terão de ter cadastro e usar um crachá de visitante e outras coisas nela participou a Jussara e a dona Lúcia na parte da tarde, no horário do almoçou faltou energia por volta de meia hora e os meninos que tirarão diretos ficarão parados (polimento e cabochão). Hoje conversei com os meninos do cabochão o seguinte tentar trabalhar com horário marcado pela manhã quanto tempo dura para corta e forma, eles falarão que no dia que as pedras forem serradas de um dia para outro da fazer  de 7 as 9hs da forma e encaneta as 30 a 32 pedras isso vai depender se não faltarem e se as pedras não forem duras e durante o dia vou obs o que poder ter horário para cada coisa o combinado foi para a manhã  de 7 as 9hs forma e encanetar as 32 pedras a tarde das 17as17:15 selecionas as pedras das 17:15 as 17:40 serrarem as 17:40 pára, para a limpeza, hoje foi entregue 31 pedras sendo 2 gotas de 16x10mm  1 quadrada de 13x10mm e 28 redonda de 12mm eles também ficarão direto ate as 18:00h. Já na joalheira foi o seguinte tentamos fazer as coisas de Fortaleza e da Maria Jose as rupestres cada um fez sua parte sem contar que teve uns atritos com o josa e o Cesar mais besteira falando que um trab + do que o outro.JOSA: pela a manhã montou a tornozeleira da Diná e entre 8:35 a 9:10 ele foi separa o material da purificação voltando para a bancada as 9:12  sendo que foi puxar material para combuca e para fazer as 1 caixa das pulseira e colares  ainda pela manhã limou as 10 caixa de uma puls rupes. E fez as 22 1 caixa de um colar e uma puls rupest. E soldou 10 cumbuca de uma pulseira rupestre pela a tarde soldou 9 cumbuca de uma pulseira rupest ainda fez 23 1 caixa de colar cara-metade e uma pulseira rupestre e cravou a pulseira rupestre colorida com elos e o anel quadrado de amazonita que de Fortaleza e pesou toda a prata.CESAR: Fez o anel de couro fazou 10 caixa de uma pulseira rupestre e saiu as 10:14 para a rua para resolver as coisa da loja com a Jussara voltando as 11:40 e tirou direto ate as 4:00 sendo que fez, serro 22 caixa e vazou 18 caixa. Isso com o intervalo da merendaPACATO: pela manhã puxou material para cumbuca montou as 10 caixa de uma pulseira rupestre e desenhou  cravou uma outra pulseira rupestre emp, em 10min. concertou o anel floral e voltou a fazer uma única caixa de uma pulseira que furou sendo que fez as cumbuca que foi usadas nas peças do dia onde também desenhou em 47 caixa e cravou o anel floral e polir o anel quadrado da cliente sem contar que tambem tirou direto e montou a pulseira rupestre com elos sendo eles todos trabalharão hoje com 298,600g de prata 950 e 46,300g de prata mil.Hoje tivemos visita de um ex funcionário o Cleber, para a manhã vamos trabalhar com as caixas que foram feitas das coisas rupestre que faltam ser limadas, vazadas, e desenhas. Tarcia vou ajudar o Zezim agora as 19:27 a lavar as peçasPEÇAS ENTREGUES CRAVADAS01Brinco navete e 01 anel floral e 02 puls. rupestrePRATA DEVOLVIDA41,200 prata 950PRATA DE PEÇAS FEITA QUE FICAM COM ELES8,800 prata mil281,200 prata950POLIMENTOPEÇAS ENTREGUE04PEÇAS CRAVADAS (MALETA) 02PEÇAS PARA CRAVAR (MALETA)",
