    "mensagem": "hoje foi colocado na produção 07 peças grafite de turmalina 01 anel olho oval que a dona Lúcia pegou ontem a noite  para entregar hj ainda sendo que ela não perguntou sobre aprodução  então  o pacato faltou hj o dia todo ai complicou mais ainda a produção ela pediu para montar e cravar 01 anel grafite e 01 anel olho oval pelo motivo de ter faltado um joalheiro e ter que cravar e montar 2 peças de hj sódeu para ficar concluido essas 2 peças mas as outras peças já estão feita só faltam montar e outros as caixas mas o polimento entregou as 7 peças do dia pela manhã os meninos meredaram na area e sujaram e não queriam limpa mas depois o Augusto limpou o josa ssaiu e não falou para onde ia passou 15min o Cesar saiu varias vezes da bancada e estava muito lento hj e expliquei que por mais que falte um joalheiro eles tem que montar as 7 peças do dia, Lúcia chegou as 15:15 e falou que era para organiza o estoque do cabochão conta e troca todos os sacos das pedras e por ter que fazer esse trabalho não deu tempo fazer os relatorios e só deu ttempo fazer a 1 gaveta. O Romulo faltou pela amanhã o cabochão entregou 32 pedras Prata mil: 35,00prata 850: 6,500prata 925: 251,4",
