    "mensagem": "Lúcia, lembra daquela minha amiga de Manaus que fez uma encomenda grade no tempo que eu estava em Fortaleza? Aquela que mandou o pendante Cactus lapidado pra consertar? Pois bem, ela até hj não conseguiu usar aquele conjunto, pois o pendante continua virando no pescoço dela....Pra evitar aborrecimentos, pois ela é uma das minhas melhores amigas e clientes, eu disse a ela que a gente iria trocar o pendante e os brincos cactus lapidados dela por qualquer peças que ela escolhesse (eu mandei uma fotos pra ela ver). Ela escolheu o seguinte: 01- pendante margarida colorida (tem que ter uma pétala transparente)02- brinco navete P transparente (pra combinar com um das pétalas da margarida)03- brinco cascata lapidado fumê Lúcia, qual o valor dessas peças que ela escolheu? E por quanto vc recebe as peças que ela está devolvendo? Garanto que estão perfeitas, pois nunca foram usadas (a minha amiga é de total confiança). Ela vai mandar as peças para devolução lá pra mamãe e a mamãe vai te entregar, certo? E quando vc tiver com as peças que ela escolheu prontas vc entrega pra mamãe que ela manda pra Manaus. Acho que assim é melhor. Tentei ligar hj a tarde, por volta das 17h15(hora de Quixeramobim), mas ninguém atendeu....Vou tentar de novo amanhã a tarde, mais ou menos 15h30, certo? Aguardo sua resposta. Grande beijo,Adriana",
